import Link from 'next/Link';
import Navbar from './Navbar';

const Layout = (props) => (
  <div>
    <Navbar/>
    {props.children}
    

    <style jsx>{`
    
      * {
        box-sizing: border-box;
        margin: 0;
        padding: 0;
      }

      



    `}</style>
  </div>
)

export default Layout;
